import React from "react";

class PeopleItem extends React.Component {
  render() {
    return <li data-selected={this.props.item.id}>
      <h2>{this.props.item.name}</h2>
      <p>{this.props.item.species.name} from {this.props.item.homeworld.name}</p>
    </li>;
  }
}

export default PeopleItem;
